import React from 'react';

// PersonalInfoComponent
const PersonalInfoComponent = (props) => {
  return (
    <div>
      <h1>Personal Info</h1>
      <p>Name: {props.name}</p>
      <p>Age: {props.age}</p>
      <p>Email: {props.email}</p>
    </div>
  );
};

// Details Component
const Details = (props) => {
  // Destructure the personalInfo prop
  const { name, age, email } = props.personalInfo;

  return (
    <div>
      <h1>Personal Info</h1>
      <p>Name: {name}</p>
      <p>Age: {age}</p>
      <p>Email: {email}</p>
    </div>
  );
};

// App Component
function App() {
  // Define personalInfo object
  const personalInfo = {
    name: "Matimba",
    age: 24,
    email: "matimba@gmail.com"
  };

  return (
    <div>
      <PersonalInfoComponent 
        name={personalInfo.name} 
        age={personalInfo.age} 
        email={personalInfo.email} 
      />

      <Details personalInfo={personalInfo} />
    </div>
  );
}

export default App;
